import React, { useState, useEffect } from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';
import { supabase } from '../../supabaseClient';
import ChartLegend from './ChartLegend';
import { calculateIndoorWithDevices } from '../../utils/airQualityCalculations';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

// Helper function to aggregate data points by day
const aggregateDataByDay = (data) => {
  const aggregatedData = {};

  data.forEach(item => {
    // Get date string without time
    const dateStr = new Date(item.date).toISOString().split('T')[0];

    if (!aggregatedData[dateStr]) {
      aggregatedData[dateStr] = {
        sum: item['PM 2.5'],
        count: 1,
        date: dateStr
      };
    } else {
      aggregatedData[dateStr].sum += item['PM 2.5'];
      aggregatedData[dateStr].count += 1;
    }
  });

  // Convert to array and calculate averages
  return Object.values(aggregatedData).map(item => ({
    date: new Date(item.date),
    'PM 2.5': item.sum / item.count
  })).sort((a, b) => a.date - b.date);
};

const PM25Chart = ({ data, userPreferences }) => {
  const [chartData, setChartData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const [activeDatasets, setActiveDatasets] = useState({
    'Outdoor': true,
    'Indoor': true
  });
  const [showEcologica, setShowEcologica] = useState(userPreferences?.hasEcologica || false);

  const toggleDataset = (name) => {
    setActiveDatasets(prev => ({
      ...prev,
      [name]: !prev[name]
    }));
  };

  useEffect(() => {
    try {
      if (!data || data.length === 0) {
        setError('No data available');
        return;
      }

      // Aggregate the data points by day
      const aggregatedData = aggregateDataByDay(data);

      const formattedData = {
        labels: aggregatedData.map(item => item.date),
        datasets: []
      };

      // Add With Air Purifier (bottom layer)
      if (showEcologica) {
        formattedData.datasets.push({
          label: 'With Air Purifier',
          data: aggregatedData.map(item => ({
            x: item.date,
            y: calculateIndoorWithDevices(
              item['PM 2.5'],
              userPreferences?.has_HVAC || false,
              true
            )
          })),
          borderColor: '#A9ED8A',
          backgroundColor: 'rgba(169, 237, 138, 0.1)',
          fill: false,
          tension: 0.4,
          borderWidth: 2,
          hidden: false
        });
      }

      // Add Indoor (middle layer)
      formattedData.datasets.push({
        label: 'Indoor',
        data: aggregatedData.map(item => ({
          x: item.date,
          y: calculateIndoorWithDevices(
            item['PM 2.5'],
            userPreferences?.has_HVAC || false,
            false
          )
        })),
        borderColor: '#D9F6BB',
        backgroundColor: 'rgba(217, 246, 187, 0.1)',
        fill: false,
        tension: 0.4,
        borderWidth: 2,
        hidden: !activeDatasets['Indoor']
      });

      // Add Outdoor (top layer)
      formattedData.datasets.push({
        label: 'Outdoor',
        data: aggregatedData.map(item => ({
          x: item.date,
          y: item['PM 2.5']
        })),
        borderColor: '#043A24',
        backgroundColor: 'rgba(4, 58, 36, 0.1)',
        fill: false,
        tension: 0.4,
        borderWidth: 2,
        hidden: !activeDatasets['Outdoor']
      });

      setChartData(formattedData);
      setIsLoading(false);
    } catch (err) {
      console.error('Error processing PM2.5 data:', err);
      setError('Failed to process PM2.5 data');
      setIsLoading(false);
    }
  }, [data, showEcologica, activeDatasets, userPreferences]);

  if (isLoading) return <div>Loading PM2.5 data...</div>;
  if (error) return <div>Error: {error}</div>;
  if (!chartData || !data.length) return <div>No PM2.5 data available</div>;

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      x: {
        type: 'time',
        time: {
          unit: 'day',
          displayFormats: {
            day: 'MMM d'
          }
        },
        title: {
          display: true,
          text: 'Date'
        },
        grid: {
          display: false
        }
      },
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'μg/m³'
        },
        grid: {
          color: 'rgba(0, 0, 0, 0.1)'
        }
      }
    },
    plugins: {
      legend: {
        display: false
      },
      tooltip: {
        mode: 'index',
        intersect: false,
        callbacks: {
          label: function(context) {
            const label = context.dataset.label || '';
            const value = context.parsed.y;
            return `${label}: ${value.toFixed(1)} μg/m³`;
          }
        }
      }
    }
  };

  return (
    <div style={{ width: '100%', height: '100%', position: 'relative' }}>
      <Line data={chartData} options={options} />
      <ChartLegend 
        activeDatasets={{
          'Outdoor': activeDatasets['Outdoor'],
          'Indoor': activeDatasets['Indoor'],
          'With Air Purifier': showEcologica
        }}
        onToggle={(label) => {
          if (label === 'With Air Purifier') {
            setShowEcologica(!showEcologica);
          } else {
            toggleDataset(label);
          }
        }}
        showAirPurifier={userPreferences?.hasEcologica}
      />
    </div>
  );
};

export default PM25Chart;
